def msgBoxHook(nCode, wParam, lParam):
    if nCode == HCBT_CREATEWND:
        createWnd = ctypes.cast(lParam, ctypes.POINTER(CBT_CREATEWND)).contents
        pcs = createWnd.lpcs.contents
        if (pcs.style & WS_DLGFRAME) and (pcs.style & WS_POPUP):
            scrw = GetSystemMetrics(SM_CXSCREEN)
            scrh = GetSystemMetrics(SM_CYSCREEN)
            pcs.x = random.randint(0, scrw - pcs.cx)
            pcs.y = random.randint(0, scrh - pcs.cy)
    return CallNextHookEx(None, nCode, wParam, lParam)

CBTProc = ctypes.WINFUNCTYPE(ctypes.c_long, ctypes.c_int, wintypes.WPARAM, wintypes.LPARAM)
msgBoxHookPtr = CBTProc(msgBoxHook)

def messageBoxThread(text="Still using this computer?", title="lol"):

    thread_id = GetCurrentThreadId()
    hook = SetWindowsHookEx(WH_CBT, msgBoxHookPtr, None, thread_id)
    MessageBoxW(None, text, "lol", MB_SYSTEMMODAL | MB_OK | MB_ICONWARNING)
    UnhookWindowsHookEx(hook)


def createThread(funk, *args, **kwargs):
    thread = threading.Thread(target=funk, args=args, kwargs=kwargs)
    thread.start()
    return thread

